import React from 'react';
import { NavLink } from 'react-router-dom';

const Error=()=>{
    return(
        <>
            <div className="setStyle2">
                <h1>Hello I am Home Page</h1>
                <p>Welcome to world</p>
                <NavLink to="/"> Go back</NavLink>
            </div>
        </>
    );
};
export default Error;
